window.bookSummaryJSON = "<p><b>A cult of death. </b></p> <p><b>A weapon of apocalyptic horror. </b></p> <p><b>Juan Cabrillo must stop them both.<b> </b></b></p> <p><b><b>The \"fascinating\" (<i> Booklist</i>) <i>New York Times</i> best seller. </b></b></p> <p><b><b>Some women you love. </b></b></p> <p><b><b>Some women you hate. </b></b></p> <p><b><b>Some women you survive. </b></b></p> <p><b><b>Doc Ford is drawn into a deadly battle when his goddaughter Shay is blackmailed. Someone filmed her at an out-of-control bachelorette party - and they want big money to keep it quiet. When Ford investigates, he finds that the woman responsible is an agent of corruption unlike any Ford has ever encountered before. And she may be the last encounter he ever has.</b> </b></p>"; 
